import React from 'react';
import { Button } from '@mui/material';
import axios from 'axios';

const WeatherPage = () => {

    let apikey = "0e8ad5de6ccc28cde19ba408fd0bd56e";

    return ( 
        <>
        <Button onClick={()=>{
            axios.get("https://api.openweathermap.org/data/2.5/weather?lat=35&lon=139&appid={0e8ad5de6ccc28cde19ba408fd0bd56e").
            then((res)=>{
                console.log(res.data);
            }).catch((err)=>{
                console.log(err.message);
            })

        }}>Test</Button>


        <h1>weather Updates will come here</h1>

        </>
     );
}
 
export default WeatherPage;
